drop table if exists fbblock;

CREATE TABLE fbblock
(
   blockID varchar(255),
   divID varchar(255),
   x1 double,
   y1 double,
   x2 double,
   y2 double
)
;

drop table if exists fbDefinedPath;

CREATE TABLE fbdefinedpath
(
   fromID varchar(255),
   toID varchar(255),
   seq int,
   roadID varchar(255),
   segmentSeq int,
   x1 double,
   y1 double,
   x2 double,
   y2 double,
   distMtr double
)
;

drop table if exists fbDiv;

CREATE TABLE fbdiv
(
   divID varchar(255),
   estateID varchar(255),
   millID varchar(255)
)
;

drop table if exists fbMill;

CREATE TABLE fbmill
(
   millID varchar(255),
   lon double,
   lat double
)
;

drop table if exists fbProgress;

CREATE TABLE fbprogress
(
   runID varchar(255),
   status varchar(4),
   iter bigint,
   maxIter bigint,
   subIter bigint,
   maxSubIter bigint,
   msg longtext,
   pct tinyint,
   lastUpd timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
   created timestamp DEFAULT 0000-00-00 00:00:00 NOT NULL
)
;
drop table if exists fbRoadSegment;

CREATE TABLE fbroadsegment
(
   roadID varchar(255),
   segmentID varchar(255),
   x1 double,
   y1 double,
   x2 double,
   y2 double,
   distMtr double
)
;
drop table if exists fbSol;

CREATE TABLE fbsol
(
   runID varchar(255),
   solTimeID varchar(255),
   solType varchar(5),
   restan double,
   lastJobEndTime int,
   lastJobEndClock varchar(5),
   vehicles int,
   recentTwist varchar(255),
   lastUpd timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL
)
;

drop table if exists fbTask;

CREATE TABLE fbtask
(
   runID varchar(255),
   solTimeID varchar(255),
   clock1 varchar(255),
   agnID varchar(255),
   splyID varchar(255),
   blocks varchar(255),
   size1 double,
   startMin int,
   arrvSplyMin int,
   waitSplyDur int,
   dprtSplyMin int,
   arrvMillMin int,
   endMin int,
   lonSply double,
   latSply double,
   lonMill double,
   latMill double,
   millName varchar(255),
   lastUpd timestamp DEFAULT CURRENT_TIMESTAMP NOT NULL,
   status varchar(255)
)
;

drop table if exists fbTaskPlan;

create table fbTaskPlan (
recordID int not null AUTO_INCREMENT
, taskDate datetime
, divID varchar(255)
, seq1 integer
, blocks varchar(255)
, size1 integer
, time1 integer
, truckID varchar(255)
, runID varchar(255)
, createDt timestamp default CURRENT_TIMESTAMP
, updDt timestamp default CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP 
, version int
, primary key (recordID)
)
;

drop table if exists fbTaskExec;

create table fbTaskExec (
recordID int not null AUTO_INCREMENT
, planID int
, taskDate datetime
, divID varchar(255)
, seq1 integer
, blocks varchar(255)
, size1 integer
, time1 integer
, truckID varchar(255)
, roadNames varchar(255)
, runID varchar(255)
, createDt timestamp default CURRENT_TIMESTAMP
, updDt timestamp default CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP 
, version int
, primary key (recordID)
)
;

drop table if exists gbRole;

create table gbRole 
(
	roleID varchar(255)
	, roleName varchar(255)
	, appID varchar(255)
	, createDt timestamp default current_timestamp
	, updDt timestamp default current_timestamp on update current_timestamp
)
;

drop table if exists gbUserRole;

create table gbUserRole
(
	userID varchar(255)
	, roleID varchar(255)
	, createDt timestamp default current_timestamp
	, updDt timestamp default current_timestamp on update current_timestamp
)
;

